                            "duration": 145,
                            "year": 2012,
                            "shortDesc": "Julayi is a 2012 Indian Telugu-language action comedy film written and directed by Trivikram Srinivas, and was produced by S. Radha Krishna under Haarika & Hassine Creations banner and was presented by DVV Danayya. The film stars Allu Arjun, Ileana D'Cruz, Sonu Sood, Rajendra Prasad, Brahmanandam, Kota Srinivasa Rao, Tanikella Bharani, Rao Ramesh and Brahmaji in the lead roles. The soundtrack was composed by Devi Sri Prasad, with cinematography handled by Chota K. Naidu and his brother Shyam K. Naidu, and editing done by Prawin Pudi.A thug named Bittu (Sonu Sood) and a local MLA named Varadarajulu (Kota Srinivasa Rao) plan to rob ₹15 billion (US$210 million) (₹1500 crore) from a bank. Ravindra Narayan (Allu Arjun) believes in earning quick money rather than toiling like his father Narayana Moorti (Tanikella Bharani). During a chance meeting with Bittu, Ravi reveals his intention of making quick money by betting on an IPL match and discloses the location of the betting ring. However, the police raids the location, and Ravi is apprehended. During interrogation, Ravi deduces that Bittu has tipped off the police to commit a crime and attempts to convince ACP Raja Manikyam (Rao Ramesh). Bittu successfully robs the bank, and his brother Lala (Shafi) takes the money to the city's dumping yard. However, the police catches Lala, who resists them, only to be killed by Ravi. Meanwhile, Bittu goes to the dumping yard to collect the money but is shocked as the dumping yard is burnt to ashes. Having his brother dead and the money burnt, Bittu decides to kill Ravi. Manikyam sends Ravi to Hyderabad from Visakhapatnam under the Witness Protection Program and makes him stay at his friend DIG Sitaram's (Rajendra Prasad) house. One day, Ravi happens to see Madhu (Ileana), a middle-class girl who works with travel agent Murthy (Brahmaji), an associate of Bittu.",
