                            "duration": 157,
                            "year": 2004,
                            "shortDesc": "Varsham is a 2004 Indian Telugu-language romantic action film produced by M.S. Raju on his Sumanth Art Productions banner and directed by Sobhan, the film stars Prabhas, Trisha, and Gopichand playing the lead roles, and the music was composed by Devi Sri Prasad.Venkat (Prabhas), an unemployed youngster, meets Shailaja (Trisha), a middle-class beauty, in a train journey, and they are immediately attracted to each other after dancing in a rain shower. At the same time, Shailaja catches the eye of Bhadranna (Gopichand), a dangerous, ruthless landlord who also fell in love with her. Venkat keeps bumping into Shailaja every time it rains, and they fall in love. Ranga Rao (Prakash Raj), Shailaja's father, is a typical black sheep with many bad habits. Bhadranna approaches him with the marriage proposal, and Ranga Rao jumps on that and agrees. Later, a film producer Seenaiah (Jaya Prakash Reddy) approaches Ranga Rao with an offer for Shailaja to act in a movie. Ranga Rao thinks that acting in films would be more lucrative than marrying her off to Bhadranna. He first successfully creates clashes between lovers, convinces Shailaja to act in a movie, and leaves with her to the city. Venkat also leaves for Vizag to his uncle's (Chandra Mohan) place. In Vizag, Shailaja becomes a leading lady in the movies, and Venkat works with his uncle in a quarry as a demolition expert. Months later, Bhadranna is cheated some money by Ranga Rao, and he finds out where Shailaja now lives, kidnaps her, and tries to change her mind about marrying him. Seenaiah gets tensed as shooting was paused, and Ranga Rao advises him to approach Venkat, as he believes that Venkat still loves Shailaja. Venkat agrees and fights with Bhadranna for Shailaja. Gradually, Shailaja comes to know that she misunderstood Venkat and apologizes. They reconcile happily, and both start loving again.",
